import axios from "axios";
import React, { useEffect, useState } from "react";
import { Card } from "react-bootstrap";
// import { IMAGE_URL } from "../helper/helper";
import logo from "../assets/image/errImg.png";

function Product() {
  const [productData, setProductData] = useState([]);

  useEffect(() => {
    getProduct();
  }, []);

  const getProduct = () => {
    axios
      .get("product")
      .then((result) => {
        console.log(result);
        setProductData(result.data.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  //   "https://geodis.com/de/sites/default/files/styles/max_800x800/public/2018-06/404.png?itok=UBITtRYD"
  return (
    // <div className="d-flex">
    <>
      {productData.map((item, i) => (
        <div className="col-3 m-3" key={i}>
          <Card style={{ width: 300, height: 250, color: "white", background: "black" }}>
            <img src={logo} alt="" width="300px" height="150px" />
            <p>{item.title}</p>
          </Card>
        </div>
      ))}
    </>
    // </div>
  );
}

export default Product;
